import React from "react";
import "./Navbar.css";

export default function Navbar() {
  return (
    <nav className="navbar navbar-dark bg-black">
      <div className="container-fluid justify-content-center">
        <a className="navbar-brand mb-0 h1">MIRRONAKE</a>
      </div>
    </nav>
  );
}
